import styled from "styled-components";

export const Container = styled.section`
  display: flex;
  width: 100%;
  margin-bottom:40px;
  border:1px solid white;
  border-radius:25px;
  @media (min-width: 768px) {
    width:48%;
  }
`;
export const Status = styled.div`
  margin:0 auto;
  & p{
  border: 2px solid #98e832;

  }
`;
